import React from 'react';
import searchContext from "./context";
import './index.css';

function UserRepo() {
    const { reposArray } = React.useContext(searchContext);
    return (
        <div>
            {reposArray.map(user =>

                <li key={user.id} className='github_repolist'>
                    <p>{user.repos_url}</p> 
                </li>
            )}
        </div>
    )
}

export default UserRepo;
